package femtodb.core.table;import java.util.*;import femtodb.core.table.data.*;/**  * DefaultTableIteratorクラス<br> * * @author Takahiro Iwase * @license Apache License 2.0  */public class DefaultTableIterator implements TableIterator {    private DataMapIterator dataMapIterator = null;    public DefaultTableIterator(DataMapIterator dataMapIterator) {        this.dataMapIterator = dataMapIterator;    }    public boolean hasNext() {        return this.dataMapIterator.hasNext();    }    public void next() {        this.dataMapIterator.next();    }    public Object getEntryKey() {        return this.dataMapIterator.getKey();    }    public Object getEntryValue() {        return this.dataMapIterator.getValue();    }    }